function List() {
  const reviewers = ['Reviewer1', 'Reviewer2', 'Reviewer3', 'Reviewer4', 'Reviewer5', 'Reviewer6'];
  const reviews = ['Good', 'Very good', 'Worst', 'Bad', 'Better', 'Not good'];

  return (
    <div>
      {reviewers.map((r, index) => (
        <ul key={index}>
          <li>{r}<br/>  - {reviews[index]}</li>
        </ul>
      ))}
    </div>
  );
}

export default List;
